script: |
  super -f text -I q10720.spq | sort > q10720.out

inputs:
  - name: q10720.spq
    data: |
      SELECT DISTINCT 66 AS col2 FROM tab2 (FORMAT parquet) WHERE + + 26 * col2 + + - col0 BETWEEN + col2 * - col0 * + 41 / col1 * col0 AND - col1;
  - name: tab2

outputs:
  - name: q10720.out
    data: |
